import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Resize.css';
import mangoLogo from '../../assets/Logo_white.png';
import userProfileImg from '../../assets/profile.jpg';

const Resize = () => {
    const [dragActive, setDragActive] = useState(false);
    const [selectedFiles, setSelectedFiles] = useState([]);
    const navigate = useNavigate();

    const handleNavigate = (path) => navigate(path);

    const handleFileChange = (event) => {
        const files = Array.from(event.target.files);
        const validFiles = files.filter(file => /\.(jpg|jpeg|png)$/i.test(file.name));
        if (validFiles.length > 0) {
            setSelectedFiles(prevFiles => [...prevFiles, ...validFiles]);
        } else {
            alert('Only .jpg, .jpeg, and .png files are allowed.');
        }
    };

    const handleDragOver = (event) => {
        event.preventDefault();
        setDragActive(true);
    };

    const handleDragLeave = () => setDragActive(false);

    const handleDrop = (event) => {
        event.preventDefault();
        setDragActive(false);
        const files = Array.from(event.dataTransfer.files);
        const validFiles = files.filter(file => /\.(jpg|jpeg|png)$/i.test(file.name));
        if (validFiles.length > 0) {
            setSelectedFiles(prevFiles => [...prevFiles, ...validFiles]);
        } else {
            alert('Only .jpg, .jpeg, and .png files are allowed.');
        }
    };

    const handleFileDelete = (index) => {
        setSelectedFiles(prevFiles => prevFiles.filter((_, i) => i !== index));
    };

    const handleUpload = () => {
        const fileData = selectedFiles.map((file, index) => ({
            id: index + 1,
            photoName: file.name,
            date: new Date().toLocaleString(),
            area: "---",
            percentage: "---"
        }));
        localStorage.setItem('uploadedFiles', JSON.stringify(fileData));
        navigate('/showareacalculation');
    };

    return (
        <div className="resize-page">
            <nav className="navbar">
                <div className="navbar-brand">
                    <img src={mangoLogo} alt="Mango Logo" className="mango-logo" />
                </div>
                <div className="navbar-links">
                    <button className="navbar-link" onClick={() => handleNavigate('/dashboardpage')}>Dashboard</button>
                    <button className="navbar-link" onClick={() => handleNavigate('/aboutuspage')}>About Us</button>
                    <button className="navbar-link" onClick={() => handleNavigate('/contactuspage')}>Contact Us</button>
                </div>
                <div className="navbar-profile" onClick={() => handleNavigate('/userprofilepage')}>
                    <img src={userProfileImg} alt="User Profile" className="user-profile" />
                </div>
            </nav>

            <main className="resize-content">
                <h1>Resize Images</h1>
                <p>Drag and drop or upload JPG, PNG files to resize them.</p>
                <div
                    className={`file-dropzone ${dragActive ? 'active' : ''}`}
                    onDragOver={handleDragOver}
                    onDragLeave={handleDragLeave}
                    onDrop={handleDrop}
                >
                    <p>Drag & Drop your images or</p>
                    <input
                        type="file"
                        id="file-upload"
                        className="file-input"
                        onChange={handleFileChange}
                        multiple
                    />
                    <label htmlFor="file-upload">Browse Files</label>
                </div>
                {selectedFiles.length > 0 && (
                    <div className="file-list">
                        <h3>Selected Files:</h3>
                        <ul>
                            {selectedFiles.map((file, index) => (
                                <li key={index}>
                                    {file.name}
                                    <button onClick={() => handleFileDelete(index)}>❌</button>
                                </li>
                            ))}
                        </ul>
                    </div>
                )}
                <div className="resize-actions">
                    <button onClick={() => handleNavigate('/dashboardpage')}>Cancel</button>
                    <button onClick={handleUpload}>Resize</button>
                </div>
            </main>

            <footer className="footer">
                <p>© 2025 Mae Fah Luang University</p>
            </footer>
        </div>
    );
};

export default Resize;
